At the end of fourth stage, we obtained 96 phytochemicals (labelled T1–T96; Figure 5; 
 Supplementary Table S1) as potential inhibitors of TMPRSS2 and 9 phytochemicals (labelled C1–C9; Figure 6; 
 Supplementary Table S2) as potential inhibitors of cathepsin L. Using IMPPAT [
 28], we provide a list of Indian medicinal plants that can produce the identified phytochemical inhibitors of TMPRSS2 and cathepsin L (
 Table 1 and 
 Table 2; 
 Supplementary Table S3). Furthermore, we have also compiled information on potential antiviral or anti-inflammatory use in traditional medicine of the herbal sources of the identified phytochemical inhibitors of TMPRSS2 and cathepsin L (
 Table 1 and 
 Table 2; 
 Supplementary Table S3). In 
 Supplementary Tables S4 and S5, we list the ligand binding site residues and non-covalent protein-ligand interactions for the identified phytochemical inhibitors of TMPRSS2 and cathepsin L. We have also predicted the physicochemical and ADMET properties of the identified phytochemical inhibitors of TMPRSS2 and cathepsin L (
 Section 3; 
 Supplementary Tables S6 and S7).
